import React from 'react';
import MoviesCard from '../MoviesCard/MoviesCard.jsx';
// import Preloader from '../Preloader/Preloader.jsx';
import styles from './MoviesCardList.module.css';
import oneFilm from '../../images/card-film__img/one_film.svg'
import twoFilm from '../../images/card-film__img/two_film.svg'
import threeFilm from '../../images/card-film__img/three_film.svg'
import fourFilm from '../../images/card-film__img/four_film.svg'
import fiveFilm from '../../images/card-film__img/five_film.svg'
import sixFilm from '../../images/card-film__img/six_film.svg'
import sevenFilm from '../../images/card-film__img/seven_film.svg'
import eightFilm from '../../images/card-film__img/eight_film.svg'
import nineFilm from '../../images/card-film__img/nine_film.svg'
import tenFilm from '../../images/card-film__img/ten_film.svg'
import elevenFilm from '../../images/card-film__img/eleven_film.svg'
import twelveFilm from '../../images/card-film__img/twelve_film.svg'
import thirteenFilm from '../../images/card-film__img/thirteen_film.svg'
import fourteenFilm from '../../images/card-film__img/fourteen_film.svg'
import fifteenFilm from '../../images/card-film__img/fifteen_film.svg'
import sixteenFilm from '../../images/card-film__img/sixteen_film.svg'


function MoviesCardsList( ) {
  const link = '#';
  return (
    <section className={styles["movies-list"]}>
        <MoviesCard
          movieName='33 слова о дизайне'
          movieImage={oneFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Киноальманах «100 лет дизайна»'
          movieImage={twoFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='В погоне за Бенкси'
          movieImage={threeFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Баския: Взрыв реальности'
          movieImage={fourFilm}
          movieLink={link}
        />
                <MoviesCard
          movieName='Бег это свобода'
          movieImage={fiveFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Книготорговцы'
          movieImage={sixFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Когда я думаю о Германии ночью'
          movieImage={sevenFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Gimme Danger: История Игги и The Stooges'
          movieImage={eightFilm}
          movieLink={link}
        />
                <MoviesCard
          movieName='Дженис: Маленькая девочка грустит'
          movieImage={nineFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Соберись перед прыжком»'
          movieImage={tenFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Пи Джей Харви: A dog called money'
          movieImage={elevenFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='По волнам: Искусство звука в кино'
          movieImage={twelveFilm}
          movieLink={link}
        />
                <MoviesCard
          movieName='Рудбой'
          movieImage={thirteenFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Скейт — кухня'
          movieImage={fourteenFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Война искусств'
          movieImage={fifteenFilm}
          movieLink={link}
        />
          <MoviesCard
          movieName='Зона'
          movieImage={sixteenFilm}
          movieLink={link}
        />
        <button
          className={styles["movies-list__more-button"]}
          type="button"
        >
          Ещё
        </button>
    </section>
  )}


export default MoviesCardsList;
